  let [좋아요,c] = useState(0);

  function plus(){
    c(좋아요 + 1)
  }

  return (
    <div className="App">
      <div className ="black-nav">
        <h4> REACT_BLOG</h4>
      </div>
      <div className="list">
        <h4> {글제목[0]} <span onClick={ plus }> 👍 </span> {좋아요} </h4>
